INSERT INTO "public"."tags" ("id", "created_at", "title", "long_text", "image_uri", "embedding", "embedding_personalitzat") VALUES ('1', '2025-03-25 08:57:13.000882+00', 'Techno', 'Techno is an electronic music genre characterized by its repetitive beats, synthetic sounds, and futuristic atmosphere. Originating in Detroit in the 1980s, techno evolved as a blend of European electronic music (such as Kraftwerk) and African-American musical influences. The core of techno is its rhythmic drive, often built around a 4/4 beat with a tempo ranging from 120 to 150 BPM. The use of drum machines, synthesizers, and sequencers creates a mechanical yet hypnotic groove, with layered, evolving textures that transport the listener into a trance-like state. Subgenres include minimal techno, which strips compositions to their bare essentials, and industrial techno, which incorporates harsher, metallic sounds. Techno thrives in underground clubs, raves, and large-scale festivals, often accompanied by pulsating lights and immersive visuals that amplify its futuristic and sometimes dystopian aesthetic.

