aican popular music that originated in the late 1970s.Initially, dancehall was a more sparse version of reggae than the roots style. A decade after, the style was officially named when the two words Dance and Hall the common venue was joined to make one word DanceHall, and it was finally promoted in an international scale. In this time digital instrumentation became more prevalent, changing the sound considerably, with digital dancehall becoming increasingly characterized by faster rhythms. Key elements of dancehall music include its extensive use of Jamaican Patois rather than Jamaican standard English and a focus on the track instrumentals.', 'https://irjubpjnvgdhlyzigdpn.supabase.co/storage/v1/object/public/images//Dancehall.webp', '[-0.0056548268,-0.020615883,0.0060533574,0.0214668,0.034726024,0.03735417,-0.0066349967,0.02636765,0.009677832,0.037569594,-0.013151512,0.0047958316,0.0028301063,-0.0057140677,-0.03548,0.026798494,0.025139745,-0.01754612,0.03929297,-0.004456542,0.046832737,0.0010272935,-0.0409948,0.003966457,0.019786509,0.04340753,-0.035458457,0.0053720856,0.029491268,0.036126263,0.011503533,-0.022274632,0.042804345,-0.015607322,0.0040337765,-0.04640189,-0.005210519,-0.032808766,-0.011826666,0.0029782087,0.011255798,-0.029534353,-0.035178408,0.020939017,0.015908914,-0.019107928,-0.013377705,-0.015542695,-0.0027924073,0.028564954,-0.048082184,-0.030417582,-0.00531823,0.028371073,0.019571086,-0.030331414,-0.030525293,0.05704374,0.014950285,0.0036056254,0.026970832,0.012903776,-0.013550042,0.019452604,0.028284905,0.0037752702,-0.049073126,-0.042761263,0.059844226,0.04635881,-0.0019993852,0.027121626,-0.020928245,-0.0034090527,-0.06699623,0.018644772,-0.0025594824,0.0048200665,0.03498453,0.08181727,0.037612677,0.010792641,-0.07061532,0.010329484,0.013733151,0.021423716,-0.021908415,-0.016382841,0.014336333,0.012332908,-0.016016623,0.034962986,-0.023954924,0.025225913,0.0051808986,-0.022985525,-0.032528717,-0.014713321,-0.015284189,0.005821779,-0.023093237